selector_to_html = {"a[href=\"dfi_switch.html\"]": "<h1 class=\"tippy-header\" id=\"dfi-switch\" style=\"margin-top: 0;\">DFI_SWITCH<a class=\"headerlink\" href=\"#dfi-switch\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0003800 + 0x0 = 0xf0003800</cite></p>", "a[href=\"identifier_mem.html\"]": "<h1 class=\"tippy-header\" id=\"identifier-mem\" style=\"margin-top: 0;\">IDENTIFIER_MEM<a class=\"headerlink\" href=\"#identifier-mem\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0005800 + 0x0 = 0xf0005800</cite></p>", "a[href=\"ethphy.html\"]": "<h1 class=\"tippy-header\" id=\"ethphy\" style=\"margin-top: 0;\">ETHPHY<a class=\"headerlink\" href=\"#ethphy\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0005000 + 0x0 = 0xf0005000</cite></p>", "a[href=\"leds.html\"]": "<h1 class=\"tippy-header\" id=\"leds\" style=\"margin-top: 0;\">LEDS<a class=\"headerlink\" href=\"#leds\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0000000 + 0x0 = 0xf0000000</cite></p>", "a[href=\"sdram.html\"]": "<h1 class=\"tippy-header\" id=\"sdram\" style=\"margin-top: 0;\">SDRAM<a class=\"headerlink\" href=\"#sdram\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0006800 + 0x0 = 0xf0006800</cite></p>", "a[href=\"timer0.html\"]": "<h1 class=\"tippy-header\" id=\"timer0\" style=\"margin-top: 0;\">TIMER0<a class=\"headerlink\" href=\"#timer0\" title=\"Link to this heading\">\u00b6</a></h1><p>Provides a generic Timer core.</p><p>The Timer is implemented as a countdown timer that can be used in various modes:</p>", "a[href=\"uart.html\"]": "<h1 class=\"tippy-header\" id=\"uart\" style=\"margin-top: 0;\">UART<a class=\"headerlink\" href=\"#uart\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0008800 + 0x0 = 0xf0008800</cite></p>", "a[href=\"reader.html\"]": "<h1 class=\"tippy-header\" id=\"reader\" style=\"margin-top: 0;\">READER<a class=\"headerlink\" href=\"#reader\" title=\"Link to this heading\">\u00b6</a></h1><p>DMA DRAM reader.</p><p>Allows to check DRAM contents against a predefined pattern using DMA.</p>", "a[href=\"controller_settings.html\"]": "<h1 class=\"tippy-header\" id=\"controller-settings\" style=\"margin-top: 0;\">CONTROLLER_SETTINGS<a class=\"headerlink\" href=\"#controller-settings\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0001000 + 0x0 = 0xf0001000</cite></p>", "a[href=\"ddrctrl.html\"]": "<h1 class=\"tippy-header\" id=\"ddrctrl\" style=\"margin-top: 0;\">DDRCTRL<a class=\"headerlink\" href=\"#ddrctrl\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0001800 + 0x0 = 0xf0001800</cite></p>", "a[href=\"interrupts.html\"]": "<h1 class=\"tippy-header\" id=\"interrupt-controller\" style=\"margin-top: 0;\">Interrupt Controller<a class=\"headerlink\" href=\"#interrupt-controller\" title=\"Link to this heading\">\u00b6</a></h1><p>This device has an <code class=\"docutils literal notranslate\"><span class=\"pre\">EventManager</span></code>-based interrupt system.  Individual modules\ngenerate <cite>events</cite> which are wired into a central interrupt controller.</p><p>When an interrupt occurs, you should look the interrupt number up in the CPU-\nspecific interrupt table and then call the relevant module.</p>", "a[href=\"main.html\"]": "<h1 class=\"tippy-header\" id=\"main\" style=\"margin-top: 0;\">MAIN<a class=\"headerlink\" href=\"#main\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0006000 + 0x0 = 0xf0006000</cite></p>", "a[href=\"rowhammer.html\"]": "<h1 class=\"tippy-header\" id=\"rowhammer\" style=\"margin-top: 0;\">ROWHAMMER<a class=\"headerlink\" href=\"#rowhammer\" title=\"Link to this heading\">\u00b6</a></h1><p>Row Hammer DMA attacker</p><p>This module allows to perform a Row Hammer attack by configuring it with\ntwo addresses that map to different rows of a single bank. When enabled,\nit will perform alternating DMA reads from the given locations, which will\nresult in the DRAM controller having to repeatedly open/close rows at each\nread access.</p>", "a[href=\"ctrl.html\"]": "<h1 class=\"tippy-header\" id=\"ctrl\" style=\"margin-top: 0;\">CTRL<a class=\"headerlink\" href=\"#ctrl\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0004800 + 0x0 = 0xf0004800</cite></p>", "a[href=\"sdram_generator.html\"]": "<h1 class=\"tippy-header\" id=\"sdram-generator\" style=\"margin-top: 0;\">SDRAM_GENERATOR<a class=\"headerlink\" href=\"#sdram-generator\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0007800 + 0x0 = 0xf0007800</cite></p>", "a[href=\"ddrphy.html\"]": "<h1 class=\"tippy-header\" id=\"ddrphy\" style=\"margin-top: 0;\">DDRPHY<a class=\"headerlink\" href=\"#ddrphy\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0000800 + 0x0 = 0xf0000800</cite></p>", "a[href=\"sdram_checker.html\"]": "<h1 class=\"tippy-header\" id=\"sdram-checker\" style=\"margin-top: 0;\">SDRAM_CHECKER<a class=\"headerlink\" href=\"#sdram-checker\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0007000 + 0x0 = 0xf0007000</cite></p>", "a[href=\"payload_executor.html\"]": "<h1 class=\"tippy-header\" id=\"payload-executor\" style=\"margin-top: 0;\">PAYLOAD_EXECUTOR<a class=\"headerlink\" href=\"#payload-executor\" title=\"Link to this heading\">\u00b6</a></h1><p><cite>Address: 0xf0004000 + 0x0 = 0xf0004000</cite></p>", "a[href=\"writer.html\"]": "<h1 class=\"tippy-header\" id=\"writer\" style=\"margin-top: 0;\">WRITER<a class=\"headerlink\" href=\"#writer\" title=\"Link to this heading\">\u00b6</a></h1><p>DMA DRAM writer.</p><p>Allows to fill DRAM with a predefined pattern using DMA.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`p ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
